import React from 'react';
import { Helmet } from 'react-helmet';
import './App.css';

function App() {
  return (
    <div className="app">
      <Helmet>
        <title>나의 자기 소개</title>
      </Helmet>
      <div className="content"> {/* 'content' 클래스를 가진 div 요소를 생성합니다. */}
        <p className="intro">안녕하세요! 저는 [이름]입니다. [직업/관심사]에 관심이 많고, [특기 또는 경험]을 가지고 있습니다.</p> {/* 자기 소개를 추가합니다. */}
        <div className="social-links"> {/* 'social-links' 클래스를 가진 div 요소를 생성합니다. */}
          <a href="https://github.com/rladkwls1108/React">GitHub</a> {/* GitHub 링크를 추가합니다. */}
        </div>
      </div>
      <footer className="footer"> {/* 'footer' 클래스를 가진 footer 요소를 생성합니다. */}
        &copy; 2024 나의 웹 페이지 {/* 저작권 정보를 추가합니다. */}
      </footer>
    </div>
  );
}

export default App;
